(1, '[\"1\"]', '[\"1\",\"2\",\"3\",\"4\"]', 2, 1, 'HOMEWORK(SUMMER VACATION)', '<ol>\r\n	<li>\r\n	<p><span style=\"font-size:12px\">Write two times and learn the poem &ldquo; First Day at School&rdquo;.</span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style=\"font-size:12px\">Write and learn the rhyme &ldquo; Brush Brush Your Teeth&rdquo;.</span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style=\"font-size:12px\">Make forty words from the word &ldquo; HIPPOPOTAMUS&rdquo;.</span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style=\"font-size:12px\">Write &ldquo;a to z&rdquo; in&nbsp;</span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style=\"font-size:12px\">Draw the pictures of things which you can carry in your school bag.</span></p>\r\n	</li>\r\n</ol>\r\n', '', '1561711596', 1561833000, 1562092200, ''),
(2, '[\"1\"]', '[\"1\",\"2\",\"3\",\"4\"]', 1, 1, 'HINDI HOMEWORK(SUMMER VACATION)', '<p><span style=\"font-size:12px\"><strong>1। बिलोम शब्द लिखो ।</strong></span></p>\r\n\r\n<ol>\r\n	<li>\r\n	<p><span style=\"font-size:12px\">ऊंचा</span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style=\"font-size:12px\">मोटा</span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style=\"font-size:12px\">ऊपर</span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style=\"font-size:12px\">लंबा</span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style=\"font-size:12px\">बड़ा</span></p>\r\n	</li>\r\n</ol>\r\n\r\n<p><span style=\"font-size:12px\"><strong>2। पाँच बोझ और सवारी करने वाले जानवरों के नाम लिखो ।( चित्रों के साथ)</strong></span></p>\r\n\r\n<p><span style=\"font-size:12px\"><strong>3 रेगिस्तान के बारे मैं पाँच बाक्य लिखो ।</strong></span></p>\r\n\r\n<p><span style=\"font-size:12px\"><strong>4 निम्नलिखित नए सब्दों को पाँच पाँच बार लिखो ।</strong></span></p>\r\n\r\n<ol>\r\n	<li>\r\n	<p><span style=\"font-size:12px\">अक्ल</span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style=\"font-size:12px\">वक्त</span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style=\"font-size:12px\">मौसम</span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style=\"font-size:12px\">हासिल</span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style=\"font-size:12px\">आफत</span></p>\r\n	</li>\r\n</ol>\r\n', '', '1561711796', 1562092200, 1562697000, '');

