(1, 'Modules', '<p>CuteBrains include multiple of modules that orchestrate together to define its services, here is the list of modules :</p>\n\n<ul>\n	<li>User groups : Administrators, teachers, students and parents</li>\n	<li>Registeration : Administrator must approve registerations of teachers, students or parents</li>\n	<li>Private messages : simple way to communicate with other users by messages</li>\n	<li>Mail / SMS : Administrators can send e-mail or SMS to teachers, students or parents</li>\n	<li>NewsBoard : Publish school news on board</li>\n	<li>Events : Publish scheduled events</li>\n	<li>Calender : List events, news, exams and online exams on calender</li>\n	<li>Attendance : Track attendance of students</li>\n	<li>Exams : Add exams scheduled for school students and grade levels</li>\n	<li>Assignments : Upload assignments related to each class</li>\n	<li>Online exams : Create online exams ( Multiple choice ) for students with auto marking</li>\n	<li>Dormitories : Add your school dormitories</li>\n	<li>Classes : Add your school classes</li>\n	<li>Class schedule : Create class schedule for each one</li>\n	<li>Subjects : Add subjects and their relation to teachers</li>\n	<li>Books library : Create online library by either download or book availability on library</li>\n</ul>\n', 1);

